/* Employee - luokka ottaa vastaan REST API:n vastauksen ja säilöö ne muuttujien sisälle.

    Attribuuttien täytyy olla samannimiset, mitä Java-backendin entity-koodissa.

*/



export class Employee {     // creating employee TypeScript class that holds respond of REST API
    id: number;             // these attributes need to match with the attributes of employee entity of Java backend spring boot project.
    firstName: string;
    lastName: string;
    emailId: string;
}
